import React, { Component } from "react";
import Grid from "@material-ui/core/Grid";
import CommandList from "./CommandList";
import Status from "./Status";
import Paper from "@material-ui/core/Paper";
import Typography from "@material-ui/core/Typography";
import DOA from "./DOA";
import Map from "./Map";
import { withScriptjs } from "react-google-maps";

class AppGrid extends Component {
  render() {
    const MapLoader = withScriptjs(Map);

    const style = {
      padding: 24
    };
    return (
      <Grid container style={style} justify="center">
        <Grid item xs={8}>
          <Typography variant="h4" gutterBottom component="h2">
            Directions
          </Typography>
          <Paper>
            <DOA />
          </Paper>
        </Grid>
        <Grid style={{ style }} item xs={4}>
          <Typography variant="h4" gutterBottom component="h2">
            Map
          </Typography>
          <Paper>
            <MapLoader
              googleMapURL="https://maps.googleapis.com/maps/api/js?key=AIzaSyCJl7fJGVQIzKzjqfcSszowI79wuduqCTY"
              loadingElement={
                <div
                  alt="The map of your location"
                  style={{ height: `100%`, margin: `5` }}
                />
              }
            />
          </Paper>
        </Grid>
        <Grid style={style} item xs={7}>
          <Typography variant="h4" gutterBottom component="h2">
            Commands
          </Typography>
          <CommandList />
        </Grid>
        <Grid style={{ paddingTop: 24, paddingLeft: 16 }} item xs={4}>
          <Typography variant="h4" gutterBottom component="h2">
            Status
          </Typography>
          <Paper>
            <Status />
          </Paper>
        </Grid>
      </Grid>
    );
  }
}

export default AppGrid;
